import { doPostAsync } from "../http/http";
import { ip, tomcatPort } from "../../misc/constants";

/**
 * @author Sven
 * Service that communicates with the backend to stop a charger
 * @version 09/08/2021
 */

/**
 * Stops a charger
 * @param id the charger's id
 * @returns {Promise<void>}
 */
const StopCharger = (id) => {
    return doPostAsync(`http://${ip}:${tomcatPort}/StopCharger`,
        {chargerID: id}, {"Content-Type": "text/plain"});
}

export {StopCharger}
